package edu.zj.pojo;

public class Student {
private int id;
private String name;
public Student() {
	super();
	// TODO Auto-generated constructor stub
}
public Student(String name) {
	super();
	this.name = name;
}
public int getId() {
	return id;
}
public void setId(int id) {
	this.id = id;
}
public String getName() {
	return name;
}
public void setName(String name) {
	this.name = name;
}



}
